(48, 'Quality Specialist (Customer Success Team)', 'https://www.cvbankas.lt/quality-specialist-customer-success-team-kaune/1-6993857', NULL, NULL, 'Kaune', '2020-11-11', '2020-12-14', 'UAB „HOSTINGER“', ' '),
(49, 'PHP Developer (Access Product)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-access-product#shortcode=136451b9-5cdc-41e3-98a2-53c9e02152eb', 'At least 2+ years of experience working with PHP;\nUnderstanding of OOP principles &amp; good code design;\nPrevious experience in building highly scalable systems;\nThat you know a thing or two about API design;\nGood (My)SQL knowledge and experience with big data quantities;\nKnowledge of Docker, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Back-end Guild Life\nFrameworks. Libraries. Databases. Repeat.\nHighly scalable applications, open-source frameworks and libraries, Sentry all the way – welcome to the back-end life. Here at Tesonet, our infrastructure is based on microservices and REST. Our SLA is to be upheld and we strive to write beautiful code as much as we can. We can’t imagine our work without RabbitMQ allowing us to execute the code of our applications asynchronously. And when it comes to databases, we trust in SQL and NoSQL to make our lives easier. Every challenge that comes our way, we smash together, unifying our logical, computing and creative skills. Even if it’s something crazy, like building a boat powered by an electric skateboard.\nSay hello to a team that’s super ambitious, hard-working and determined to always keep it high-quality. A year ago we were just a group of enthusiasts, tiptoeing around the idea of a new security product. During that year, we’ve not only built that product but also successfully introduced it to the market. Today our product has hundreds of thousands users around the world and we don’t plan to stop there. As we said, our team is ambitious. Very ambitious. We work alongside professionals from different fields on the same goal - growing and scaling our product. Here, we’re driven by data, numbers and north star metric is what guides us through the darkest night. New ideas and approaches come from constant experimenting, and talking to the customers. So if you want to be a part of building a brand and a product that’s gonna shake the world - this is your chance!', 'Kaunas', '2020-11-11', '2020-12-27', NULL, NULL),
(50, 'PHP Developer (Business Security Solutions)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-business-security-solutions#shortcode=72d4eb7c-13be-4c62-a0ac-30fa13360e10', 'At least 3+ years of experience working with PHP;\nUnderstanding of OOP principles &amp; good code design;\nPrevious experience in building highly scalable systems;\nThat you know a thing or two about API design;\nGood (My)SQL knowledge and experience with big data quantities;\nKnowledge of Docker, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Back-end Guild Life\nFrameworks. Libraries. Databases. Repeat.\nHighly scalable applications, open-source frameworks and libraries, Sentry all the way – welcome to the back-end life. Here at Tesonet, our infrastructure is based on microservices and REST. Our SLA is to be upheld and we strive to write beautiful code as much as we can. We can’t imagine our work without RabbitMQ allowing us to execute the code of our applications asynchronously. And when it comes to databases, we trust in SQL and NoSQL to make our lives easier. Every challenge that comes our way, we smash together, unifying our logical, computing and creative skills. Even if it’s something crazy, like building a boat powered by an electric skateboard.', 'Vilnius', '2020-11-11', '2020-12-27', NULL, NULL),
(51, 'PHP Developer (Security Product)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-security-product#shortcode=063efb16-0995-433a-9cfd-3284338b8d2a', 'At least 2+ years of experience working with PHP;\nUnderstanding of OOP principles and good code design;\nPrevious experience in building highly scalable systems;\nThat you know a thing or two about API design;\nGood (My)SQL knowledge and experience with big data quantities;\nKnowledge of Docker, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Back-end Guild Life\nFrameworks. Libraries. Databases. Repeat.\nHighly scalable applications, open-source frameworks and libraries, Sentry all the way – welcome to the back-end life. Here at Tesonet, our infrastructure is based on microservices and REST. Our SLA is to be upheld and we strive to write beautiful code as much as we can. We can’t imagine our work without RabbitMQ allowing us to execute the code of our applications asynchronously. And when it comes to databases, we trust in SQL and NoSQL to make our lives easier. Every challenge that comes our way, we smash together, unifying our logical, computing and creative skills. Even if it’s something crazy, like building a boat powered by an electric skateboard.', 'Vilnius', '2020-11-11', '2020-12-27', NULL, NULL),
(52, 'PHP Developer (Web Product)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-web-product#shortcode=21a90fbe-9a55-43d7-9353-cfb05e5a9cf4', 'At least 2+ years of experience working with PHP;\nUnderstanding of OOP principles &amp; good code design;\nExperience with PHP frameworks (Symfony, Laravel, etc.);\nThat you know a thing or two about API design;\nGood (My)SQL knowledge and experience;\nKnowledge of Docker, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Fascinating things happen where two different origins collide. In our case, it’s media and technology. We develop exceptional online sources for cybersecurity and privacy discoveries, opinions, news, and advice. Our research helps people all over the world make smarter, more confident, and informed decisions about their behaviors online. We succeed because of data-driven research, bold experiment ideas, and the driving force - our team of flexible, vigilant, constantly learning professionals.\nIf you live and breathe web technologies; if you want to build things and see how they perform in the real world; if you like combining your expertise with the others, then join our squad and make an impact!', 'All', '2020-11-11', '2021-09-03', NULL, NULL),
