(330, 'PHP Developer (File Security Product)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-file-security-product#shortcode=450aaf5f-7f90-4549-8701-9aa2543e8190', 'At least 2+ years of experience working with PHP;\nUnderstanding of OOP principles &amp; good code design;\nPrevious experience in building highly scalable systems;\nThat you know a thing or two about API design;\nGood (My)SQL knowledge and experience with big data quantities;\nKnowledge of Docker, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Say hello to a team that’s super ambitious, hard-working and determined to always keep it high-quality. A year ago we were just a group of enthusiasts, tiptoeing around the idea of a new security product. During that year, we’ve not only built that product but also successfully introduced it to the market. Today our product has hundreds of thousands users around the world and we don’t plan to stop there. As we said, our team is ambitious. Very ambitious. We work alongside professionals from different fields on the same goal - growing and scaling our product. Here, we’re driven by data, numbers and north star metric is what guides us through the darkest night. New ideas and approaches come from constant experimenting, and talking to the customers. So if you want to be a part of building a brand and a product that’s gonna shake the world - this is your chance!', 'Vilnius', '2021-01-13', '2021-04-26', NULL, NULL),
