(356, 'PHP developer (Privacy Protection Product)', 'https://tesonet.com/career/all-positions/?job-title=php-developer-privacy-protection-product#shortcode=5498d08f-ea33-4f99-94ef-4388f46f906e', '2+ years of experience working with PHP;\nUnderstanding of OOP principles &amp; good code design;\nExperience with Symfony framework would be an advantage;\nPrevious experience in building highly scalable systems;\nSolid technical understanding of RESTful API’s;\nGood (My)SQL knowledge and experience with big data quantities;\nThat you know a thing or two about microservices design;\nKnowledge of MongoDB, RabbitMQ and Redis is a plus;\nThat working with Git is nothing new to you.', 'Driven by pushing the boundaries of what’s seemingly-impossible and making quality a norm - that’s what we’re passionate about. Not so long ago we were a small crew entering the challenging cybersecurity industry. Well, today we’re respected leaders rocking in the global market and growing at the speed of light.\nOur team consists of ambitious professionals who work hard to create the best cybersecurity solutions and outsmart the demanding competition. If you’re looking for the best tech challenge of your life, this is your sign.', 'Vilnius', '2021-01-23', '2021-04-01', NULL, NULL),
